script: |
  super -f tsv -I q310.sql | sort > q310.out

vector: true

inputs:
  - name: q310.sql
    data: |
      SELECT e
      FROM t1
      WHERE c>d
      AND coalesce(a,b,c,d,e)<>0
      AND a>b;
  - name: t1

outputs:
  - name: q310.out
    data: |
      132
      173
      180
      189
      210
